import React, { Component } from "react";
import CardList from './CardList';
import SearchBox from './SearchBox';
import { Robots } from './Robots';

class App extends Component{
    constructor() {
        super()
        this.state = {
            Robots: Robots,
            searchField: ''
        }
    }
    render() {

        return (
            <div className={'tc'}>
                <h1>RoboFriends</h1>
                <SearchBox/>
                <CardList Robots={Robots}/>
            </div>
        );
    }
}

export default App;
